class Solution:
    def maxOperations(self, s: str) -> int:
        count = 0
        res = 0
        firstSeen = False
        for ch in s:
            if ch == '1':
                count += 1
                firstSeen = True
            else:
                if firstSeen:
                    res += count
                    firstSeen = False
        return res
